import { SingleEliminationBracket } from '@g-loot/react-tournament-brackets';

const SingleBracketView = () => {
  return (
    <div style={{ width: '100%', overflowX: 'auto' }}>
      <SingleEliminationBracket
        matches={fakeBracketData.matches}
        matchComponentProps={{
          onMatchClick: (match) => console.log('Clicked match:', match),
        }}
        participantComponentProps={{
          onParticipantClick: (p) => console.log('Clicked participant:', p),
          showResults: false
        }}
      />
    </div>
  );
};

export default SingleBracketView;
